import React, {useState } from 'react';
import Row from '../row/Row';
import request from '../../commons/requests';
function Home() {
    const [requestURL, setrequestURL] = useState([request]);
    return (
        <div>
           {
              requestURL.map(value=>(
                <Row title={value.title} fetchURL={value.URL}/>
              )) 
              
           }
        </div>
    )
}
export default Home
